def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if item <= bins[i]/2:
            if item % 6 == 0:
                priorities[i] = (item + 2) / bins[i]
            elif item % 6 == 1:
                priorities[i] = 2*(item + 4) / bins[i]
            elif item % 6 == 2:
                priorities[i] = 3*(item + 6) / bins[i]
            elif item % 6 == 3:
                priorities[i] = (item + 8) / bins[i]
            elif item % 6 == 4:
                priorities[i] = 5*(item + 10) / bins[i]
            else:
                priorities[i] = (item + 12) / bins[i]
        elif item > bins[i]/2 and item <= bins[i]:
            if bins[i] % 4 == 0:
                priorities[i] = np.power(item / bins[i], 1.8) + np.log(item / bins[i])
            elif bins[i] % 4 == 1:
                priorities[i] = np.power(item / bins[i], 0.5) + np.log2(item / bins[i])
            elif bins[i] % 4 == 2:
                priorities[i] = np.power(item / bins[i], 2) + np.log10(item / bins[i])
            else:
                priorities[i] = np.power(item / bins[i], 0.7) + np.log1p(item / bins[i])
        else:
            if item % 8 == 0:
                priorities[i] = np.sqrt(item / bins[i]) + np.square(item / bins[i])
            elif item % 8 == 1:
                priorities[i] = np.exp(item / bins[i]) + np.cbrt(item / bins[i])
            elif item % 8 == 2:
                priorities[i] = np.log10(item / bins[i]) + np.sqrt(item / bins[i])
            elif item % 8 == 3:
                priorities[i] = np.log1p(item / bins[i]) + np.cbrt(item / bins[i])
            elif item % 8 == 4:
                priorities[i] = np.log(item / bins[i]) + np.square(item / bins[i])
            elif item % 8 == 5:
                priorities[i] = np.log2(item / bins[i]) + np.sqrt(item / bins[i])
            elif item % 8 == 6:
                priorities[i] = np.cbrt(item / bins[i]) + np.exp(item / bins[i])
            else:
                priorities[i] = np.square(item / bins[i]) + np.log(item / bins[i])

    return priorities
